package com.example.pashko00710.testparser.rest.model;import com.google.gson.annotations.SerializedName;import java.util.ArrayList;public class ImeiModel {    @SerializedName("upload")    private ImeiData upload;    @SerializedName("errors")    private ArrayList<String> errors;    @SerializedName("data")    private String data;    @SerializedName("status")    private String status;    public ImeiData getImeiData() {        return upload;    }    public void setImeiData(ImeiData upload) {        this.upload = upload;    }    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    public String getData() {        return data;    }    public void setData(String data) {        this.data = data;    }    public void setErrors(ArrayList<String> errors) {        this.errors = errors;    }    public ArrayList<String> getErrors() {        return errors;    }}